import React from 'react';

const Input = ({ val, onChange, onSubmit }) => {
    return (
        <form onSubmit={e => onSubmit(e.target.value)}>
            <input
                type='text'
                style={{ width: '300px', borderRadius: '5px', height: '40px', textAlign: 'center', fontSize: '24px' }}
                onChange={e => onChange(e.target.value)}
                value={val}
                placeholder='Add Todo Here'
            />
        </form>
    )
}

export default Input;
